import React, { Component } from "react";
import Header from "../header/header";
import Overview from "../overview/overview";
import Preview from "../preview/preview";

class Projects extends Component {
  state = {
    projects: [
      {
        id: "1",
        name: "Classify App",
        description:
          "Mobile app connecting students with local classes, providing exposure to new fields without the commitment of semester-long courses.",
        tags: [
          "UI/UX Design",
          "Persona Creation",
          "Storyboarding Sketching",
          "Wireframing",
          "Prototyping",
          "Usability Testing",
        ],
        tagsList: tags.map((t) => {
          <li>t</li>;
        }),
      },
    ],
  };

  render() {
    return (
      <>
        <Header />
        <div>
          <Overview projects={this.state.projects} />
          <Preview projects={this.state.projects} />
        </div>
      </>
    );
  }
}

export default Projects;
